export default function ContactForm() {
	return (
		<div className="contact-form-wrapper">
			<div className="contact-info-wrapper">
				<h2>Store Information</h2>
				<p>Ecolife Responsive Prestashop Theme United States</p>
				<p>Call us: (+800)345678</p>
				<p></p>
			</div>
			<div className="contact-from-wrapper"></div>
		</div>
	);
}
